package com.jiagouedu.services.manage.catalog.impl;import com.jiagouedu.core.ServersManager;import com.jiagouedu.services.manage.catalog.FrontCatalogService;import com.jiagouedu.services.manage.catalog.bean.FrontCatalog;import com.jiagouedu.services.manage.catalog.dao.FrontCatalogDao;import org.springframework.stereotype.Service;import javax.annotation.Resource;import java.util.List;@Service("frontCatalogService")public class FrontCatalogServiceImpl implements		FrontCatalogService {    @Resource(name = "frontCatalogDao")	protected FrontCatalogDao dao;    public void setDao(FrontCatalogDao frontCatalogDao) {        this.dao = frontCatalogDao;    }	public List selectList(FrontCatalog e){    	return this.dao.selectList(e);	}	}